import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const footerStyle = {
	backgroundColor: '#f9f9f9',
	padding: '40px 0',
	color: '#333',
	fontSize: '14px',
};

const sectionTitleStyle = {
	fontWeight: 'bold',
	marginBottom: '20px',
	fontSize: '16px',
};

const linkStyle = {
	color: '#333',
	textDecoration: 'none',
	fontSize: '14px',
	marginBottom: '8px',
	display: 'block',
};

const inputStyle = {
	width: '100%',
	padding: '10px',
	margin: '10px 0',
	borderRadius: '4px',
	border: '1px solid #ced4da',
};

const buttonStyle = {
	padding: '10px 20px',
	backgroundColor: '#ffc107',
	color: '#333',
	border: 'none',
	borderRadius: '4px',
	cursor: 'pointer',
	fontSize: '14px',
};

const socialIconsStyle = {
	display: 'flex',
	gap: '10px',
	marginTop: '20px',
};

const iconStyle = {
	fontSize: '20px',
	color: '#333',
	transition: 'color 0.3s',
};

const copyrightStyle = {
	marginTop: '20px',
	fontSize: '12px',
	color: '#6c757d',
	textAlign: 'center',
};

const Footer = () => {
	return (
		<footer style={footerStyle}>
			<Container>
				<Row>
					<Col md={4}>
						<div style={{ textAlign: 'center', marginBottom: '20px' }}>
							<input type="email" placeholder="Email của bạn" style={inputStyle} />
							<button style={buttonStyle}>Gửi !</button>
						</div>
						<h4 style={sectionTitleStyle}>Về NghienDT</h4>
						<a href="#" style={linkStyle}>Giới Thiệu</a>
						<a href="#" style={linkStyle}>Điều Khoản Sử Dụng</a>
						<a href="#" style={linkStyle}>Chính Sách Bảo Mật</a>
						<a href="#" style={linkStyle}>Quy Định Cần Biết</a>
						<a href="#" style={linkStyle}>Liên Hệ Hỗ Trợ</a>
					</Col>
					<Col md={4}>
						<h4 style={sectionTitleStyle}>Hỗ Trợ Khách Hàng</h4>
						<a href="#" style={linkStyle}>Cách Thức Thanh Toán</a>
						<a href="#" style={linkStyle}>Trả Hàng & Hoàn Tiền</a>
						<a href="#" style={linkStyle}>Chính Sách Mua Hàng</a>
						<a href="#" style={linkStyle}>Chính Sách Bảo Hành</a>
						<a href="#" style={linkStyle}>Vận Chuyển Hàng</a>
					</Col>
					<Col md={4}>
						<h4 style={sectionTitleStyle}>Liên Hệ</h4>
						<a href="#" style={linkStyle}>Địa chỉ: Viện Khoa học Kĩ thuật Bưu điện</a>
						<a href="#" style={linkStyle}>Email: abc@gmail.com</a>
						<a href="#" style={linkStyle}>Điện thoại: 0123456789</a>
					</Col>
				</Row>
				<Row>
					<Col style={{ textAlign: 'center' }}>
						<div style={socialIconsStyle}>
							<a href="https://twitter.com" style={iconStyle}><i className="fab fa-twitter"></i></a>
							<a href="https://facebook.com" style={iconStyle}><i className="fab fa-facebook-f"></i></a>
							<a href="https://instagram.com" style={iconStyle}><i className="fab fa-instagram"></i></a>
						</div>
						<p style={copyrightStyle}>© {new Date().getFullYear()} Bản quyền thuộc về Phạm Khánh</p>
					</Col>
				</Row>
			</Container>
		</footer>
	);
};

export default Footer;
